import React from 'react';
import { BrowserRouter, Navigate, Route, Routes } from 'react-router-dom';
import Header from './Components/Header';
import Signup from './Components/Signup';
import Login from './Components/Login';
import Navbar from './Components/Navbar';
import { useAuthContext } from './hooks/useAuthContext';
import OwnerLogin from './Components/Owner/OwnerLogin';
import OwnerSignup from './Components/Owner/OwnerSignup';
import OwnerHome from './Components/Owner/OwnerHome';
import Home from './Components/Home';

function App() {
  const { user } = useAuthContext();
  //console.log(user.types);

  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path="/" element={!user ? <Header /> : <Navigate to="/" />} />
        <Route path="/Login" element={!user ? <Login /> : <Navigate to="/" />} />
        <Route path="/Signup" element={!user ? <Signup /> : <Navigate to="/" />} />
        <Route path="/OwnerLogin" element={!user ? <OwnerLogin /> : <Navigate to="/" />} />
        <Route path="/OwnerSignup" element={!user ? <OwnerSignup /> : <Navigate to="/" />} />
        <Route path="/Home" element={user ? <Home /> : <Navigate to="/" />} />
        <Route path="/OwnerHome" element={user ? <OwnerHome /> : <Navigate to="/" />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
